import './App.css';
import axios from 'axios';
const API_URL = 'http://localhost:8080';


import React, { Component } from 'react';
import{
  BrowserRouter as Router, Route
} from 'react-router-dom';
import KitapKayit from './components/AnaSayfa/4-KitapKayit/KitapKayit';
import Anasayfa from './components/AnaSayfa/Anasayfa';
import KitabaGit from '../src/components/AnaSayfa/KitabaGit';

const Home = () => (
  <Anasayfa></Anasayfa>

);
const kitapkayit = () => (
  <KitapKayit></KitapKayit>

);
const kitabagit = () => (
  <KitabaGit></KitabaGit>

);





 class App extends Component {
  state = {
    users: []
  }
  componentDidMount() {
    const url = `${API_URL}/books/`;
    axios.get(url).then(response => response.data)
    .then((data) => {
      this.setState({ users: data })
     })
  }
  render() {
    return (
      <Router>
      <div>  
      <Route exact path ="/"  component= {Home}/>  
      <Route path ="/kitapkayit"  component= {kitapkayit}/>  
      <Route path ="/kitabagit"  component= {kitabagit}/>  



               </div>
                     </Router>
    )
  }
}
export default App;
